import React, { useEffect } from "react";
import Pins from "../../data/map.json";

const Landmark = ({ map }) => {
  useEffect(() => {
    map.addSource("places-pins", {
      type: "geojson",
      data: Pins,
    });

    map.addLayer({
      id: "landmarks",
      type: "symbol",
      source: "places-pins",
      layout: {
        "icon-image": "{icon}",
        "icon-allow-overlap": true,
      },
    });
  });

  return <div></div>;
};

export default Landmark;
